import React, { useState, useEffect } from "react";
import axios from "axios";

const Component1 = () => {
  const [data, setData] = useState("");
  const [loading, setLoading] = useState(true);
  let part = 1;

  let config = {
    method: "get",
    url: `http://localhost:8080/part?id=${part}`,
    headers: {},
  };
  useEffect(() => {
    axios(config)
      .then(function (response) {
        setData(response.data.data);
        setLoading(false);
      })
      .catch(function (error) {
        console.log(error);
      });
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []);

  const isObject = (value) => {
    if (value === null) {
      return false;
    }
    return typeof value === "object";
  };

  // Create a function that takes an object and returns a table of its properties and values.
  const JsonTableComponent = (json) => {
    if (isObject(json)) {
      let table = [];
      for (let key in json) {
        if (json.hasOwnProperty(key)) {
          table.push(
            <tr key={key}>
              <td>{key}</td>
              <td>{JsonTableComponent(json[key])}</td>
            </tr>
          );
        }
      }
      return (
        <table className="table" border="1">
          <tbody>{table}</tbody>
        </table>
      );
    }
    return json;
  };

  // Create a function to count the nested objects in an object.
  const countNestedObjects = (obj) => {
    let count = 0;
    for (let key in obj) {
      if (obj.hasOwnProperty(key)) {
        if (isObject(obj[key])) {
          count++;
          count += countNestedObjects(obj[key]);
        }
      }
    }
    return count;
  };

  // Create a function to count the nesting level of an object.
  const countNestingLevel = (obj) => {
    let count = 0;
    for (let key in obj) {
      if (obj.hasOwnProperty(key)) {
        if (isObject(obj[key])) {
          count++;
          count += countNestingLevel(obj[key]);
        }
      }
    }
    return count;
  };

  // Create a function to count how many leves deep an object is.
  const countLevelsDeep = (obj) => {
    let count = 0;
    for (let key in obj) {
      if (obj.hasOwnProperty(key)) {
        if (isObject(obj[key])) {
          count++;
          count += countLevelsDeep(obj[key]);
        }
      }
    }
    return count;
  };

  // Create a function to count how many leves has an object
  const countLevels = (obj) => {
    let count = 0;
    for (let key in obj) {
      if (obj.hasOwnProperty(key)) {
        if (isObject(obj[key])) {
          count++;
          count += countLevels(obj[key]);
        }
      }
    }
    return count;
  };

  console.log("nested", countLevels(data));

  return (
    <>
      {loading ? (
        <div>Loading...</div>
      ) : (
        <div>
          <div>
            <br />
            <br />
            <hr />
            <br />
            <br />
            <br />
            <JsonTableComponent json={data} />
          </div>
        </div>
      )}
    </>
  );
};

export default Component1;
